$(document).ready(function () {

    $("img").hide();

    $("#search").keyup(function(){

        // Retrieve the input field text 
        var filter = $(this).val();

        // Loop through the captions div 
        $("img").each(function(){

            // If the div item does not contain the text phrase fade it out
            if ($(this).attr('alt').search(new RegExp(filter, "i")) < 0) {
                $(this).fadeOut();

            // Show the div item if the phrase matches 
            } else {
                $(this).show();
                var alt = $(this).attr('alt');
                var url = 'https://kylewhirl.com/SFsymbols/create.html?path=' + alt ;
                $("img").wrap($("<a>").attr("href", url));
            }
        });
     });
 });
</script>
